window.bookSummaryJSON = "<p><b>The Dimensional Seed is about to mature. The battle for it will decide Earth's fate.</b></p> <p>Urged on by the System itself, Zac has set his sights on the heart of the Mystic Realm. That's where the Dominators are heading, and it might be where the answers to his bloodline can be found.</p> <p>However, the followers of the Great Redeemer are not the only ones Zac and his companions have to worry about. The trapped factions of the Realm itself have plans of their own. Even eldritch horrors are flocking to the Mystic Realm, attracted by the powerful treasure in its center.</p> <p>Book 7 of the hit Defiance of the Fall LitRPG series is here. Grab your copy today!</p> <p><b>About the Series:</b> Jump into a story that merges Apocalyptic LitRPG elements with eastern cultivation. Class systems, skill systems, endless choices for progression, it has everything fans of the genre love. Explore a vast universe full of mystery, adventure, danger and even aliens; where even a random passer-by might hold the power of a god. Follow Zac as he struggles to stake out a unique path to power as a mortal in a world full of cultivators.</p>"; 
